import React from 'react';
import "./menu-card.css"

const MenuCard = () => {
    return(
        <div className='main-menu'>
            <P>CATEGORIES</P>
            <ul>
                <li>BEST SELLERS</li>
                <li>WHAT'S NEW</li>
                <li>EARRINGS</li>
                <li>NECKLACES</li>
                <li>BRACELETS</li>
                <li>RESIN AND MORE</li>
            </ul>
        </div>
    )
}

export default MenuCard;
